import React, { useEffect } from 'react';
import confetti from 'canvas-confetti';

const ThankYouPage = () => {
  useEffect(() => {
    console.log('ThankYouPage mounted');
    // Trigger confetti animation
    confetti({
      particleCount: 100,
      spread: 70,
      origin: { y: 0.6 }
    });
  }, []);

  return (
    <div style={{ minHeight: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', backgroundColor: '#f0f0f0' }}>
      <div style={{ textAlign: 'center', padding: '2rem', backgroundColor: 'white', borderRadius: '8px', boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)' }}>
        <h1 style={{ fontSize: '2rem', color: '#4CAF50', marginBottom: '1rem' }}>Thank You!</h1>
        <p style={{ fontSize: '1.2rem', marginBottom: '1rem' }}>
          Your onboarding form has been submitted successfully.
        </p>
        <p style={{ fontSize: '1rem' }}>
          One of our team members will be in touch with you shortly.
        </p>
        <p style={{ fontSize: '1rem', marginTop: '1rem' }}>
          We're excited to have you join the Audiology Plus family!
        </p>
      </div>
    </div>
  );
};

export default ThankYouPage;
